#Problem5a = int(input())def get_input(x):    data = [0] * x    for i in range(x):        data[i] = int(input())    return datadata = get_input(a)print(data)c = int(input())n = int(input())def solution(data, c, n):    x = 0    for i in range(len(data)):        if data[i] >= c:            x = x + 1    return(bool(x>=n))answer = solution(data, c, n)print(answer)